import { NavLink } from "react-router-dom";

import classes from "./MainNavigation.module.css";

function MainNavigation() {
  const activLink = ({ isActive }) => (isActive ? classes.active : undefined);

  //    - / => HomePage
  //    - /events => EventsPage
  //    - /events/<some-id> => EventDetailPage
  //    - /events/new => NewEventPage
  //    - /events/<some-id>/edit => EditEventPage

  return (
    <header className={classes.header}>
      <nav>
        <ul className={classes.list}>
          <li>
            <NavLink
              to=""
              activeClassName={classes.active}
              className={activLink}
              end
            >
              Home
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/events"
              activeClassName={classes.active}
              className={activLink}
            >
              Events
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/events/event_1"
              activeClassName={classes.active}
              className={activLink}
            >
              Event 1 Detail Page
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/events/new"
              activeClassName={classes.active}
              className={activLink}
            >
              New Event
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/events/event_1/edit"
              activeClassName={classes.active}
              className={activLink}
            >
              Edit Event 1
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default MainNavigation;
